(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0cf780"],{"649e":function(r,n,e){"use strict";e.r(n);var t=e("7a23");function o(r,n,e,o,c,s){var a=Object(t["resolveComponent"])("v-md-preview");return Object(t["openBlock"])(),Object(t["createElementBlock"])("div",null,[Object(t["createVNode"])(a,{text:o.md},null,8,["text"])])}var c='\x3c!--\r\n * @Author: snltty\r\n * @Date: 2021-10-12 16:31:35\r\n * @LastEditors: snltty\r\n * @LastEditTime: 2021-10-16 01:14:50\r\n * @version: v1.0.0\r\n * @Descripttion: 功能说明\r\n * @FilePath: \\client.web.vue3\\src\\views\\about\\server-tcp-fprward.md\r\n--\x3e\r\n# 服务器转发实现内网穿透\r\n## 并不是所有时候都可以打洞成功，这时候就需要服务端转发实现内网穿透\r\n--\r\n\r\n## 服务端  server.service\r\n```\r\n{\r\n  "udp": 5410,\r\n  "tcp": 59410,\r\n  "tcpForward": false //此配置项设置为true  重新运行\r\n}\r\n```\r\n-- \r\n\r\n## 客户端  client.service.serverTcpforward \r\n配置文件  servertcpforward-appsettings.json\r\n<font color="red">如果未开启自动注册(AutoReg)，则需要在**插件配置**页面，**启用插件(已启用需重新启用) 或者 保存配置**，才会注册转发</font>\r\n```\r\n{\r\n    //web转发\r\n    // 一个端口可对应多个host，同端口，不同host转发到内网不同的服务\r\n  "Web": [\r\n    {\r\n      "Port": 8099, //服务器端口\r\n      "Forwards": {\r\n        "test1.snltty.com": {\r\n          "TargetPort": 8099, //内网端口\r\n          "TargetIp": "127.0.0.1" //内网服务地址\r\n        }\r\n      }\r\n    }\r\n  ],\r\n  //tcp协议转发\r\n  // 一个端口对应一个内网服务\r\n  "Tunnel": [\r\n    {\r\n      "Port": 3388, //服务器端口\r\n      "TargetPort": 3389, //内网端口\r\n      "TargetIp": "127.0.0.1" //内网服务地址\r\n    }\r\n  ],\r\n  "Enable": true,  //是否启用，当不启用时，表示不允许访问本地服务\r\n  "AutoReg": true  //是否自动注册， 当开启时， “客户端注册”成功后，将自动注册转发\r\n}\r\n\r\n```',s={setup:function(){return{md:c}}},a=e("6b0d"),p=e.n(a);const u=p()(s,[["render",o]]);n["default"]=u}}]);